import { View, Text, TouchableOpacity, Image} from 'react-native'
import React from 'react'
import { SafeAreaView } from 'react-native-safe-area-context'
import { COLORS, icons } from '../constants';

const Input = () => {
  return (
    <SafeAreaView style={{
      flex: 1,
      backgroundColor: COLORS.green,
    }}>
      <View style={{
        flex: 1,
        flexDirection: 'row',
        justifyContent: 'center',
        backgroundColor: COLORS.green,
        padding: 16,
        maxHeight: 100,
        borderBottomEndRadius:10
      }}>
        <Text
          style={{
            fontSize: 20,
            fontWeight: "bold",
            color: COLORS.black,
            marginTop: 10,
            marginLeft: 10,
            height: 50,
          }}
        >Halaman Input Data Harga Komoditi
        </Text>
      </View>
      <View style={{
        flex: 1,
        backgroundColor: COLORS.white,
        padding: 16,
      }}>
        <Text
          style={{
            fontSize: 16,
            fontWeight: 'bold',
            color: COLORS.black,
            textAlign: 'left',
          }}
        >Cari Berdasarkan Kecamatan
        </Text>
      </View>
    </SafeAreaView>
  )
}

export default Input;
